Map unique strings to (incrementing) numbers in MongoDB<p>Assume that I have documents with <code>timestamp</code>, <code>sensor_name</code>, and <code>value</code> (modelling some measurements) such as</p>
<pre><code>{
  timestamp: 1,
  sensor_name: &quot;Sensor A&quot;,
  value: 10
}
{
  timestamp: 2,
  sensor_name: &quot;Sensor B&quot;,
  value: 11
}
{
  timestamp: 7,
  sensor_name: &quot;Sensor A&quot;,
  value: 5
}
{
  timestamp: 10,
  sensor_name: &quot;Sensor A&quot;,
  value: 13
}
{
  timestamp: 12,
  sensor_name: &quot;Sensor B&quot;,
  value: 20
}
</code></pre>
<p>How could I map each unique <code>sensor_name</code> to a unique number and query it in the form</p>
<pre><code>{
  timestamp: 1,
  sensor_nr: 1,
  value: 10
}
{
  timestamp: 2,
  sensor_nr: 2,
  value: 11
}
{
  timestamp: 7,
  sensor_nr: 1,
  value: 5
}
{
  timestamp: 10,
  sensor_nr: 1,
  value: 13
}
{
  timestamp: 12,
  sensor_nr: 2,
  value: 20
}
</code></pre>
<p>In general, I do not care if <em>Sensor A</em> becomes <em>1</em> and <em>Sensor B</em> becomes <em>2</em> or vice-versa.</p>
<p>The answer should be general, there could be more than 20 sensors, no &quot;hardcoding&quot; of possible sensor names, they may not follow a certain naming pattern.</p>

