Mongoose - How to require two Schema files from eachother without circular dependency error?<p>In my Node.js project, I have two schemas, <code>ProductSchema</code> and <code>ReviewSchema</code>. They are located in different files. In <code>Product.js</code> (which contains the <code>ProductSchema</code>), I have a <code>.pre remove</code> hook, that removes all the reviews associated with the product. For this to work, I have to require Review.js (which contains the ReviewSchema). So far so good, but I wanted to implement a hook in the <code>ReviewSchema</code> to fire a review's been created/edited/deleted to update the <code>product's avarageRating field</code>. For this, I referenced <code>Review.js</code>, thus creating a circular dependency error between <code>Review.js</code> and <code>Product.js</code>.</p>
<p>// Product.js</p>
<pre><code>const Review = require(&quot;./Review&quot;);

[...]

ProductSchema.pre(&quot;remove&quot;, function (next) {
    // ...remove all Reviews that reference it ...
    Review.deleteMany({ product: this._id });
    next();
});

module.exports = new mongoose.model(&quot;Product&quot;, ProductSchema);
</code></pre>
<p>// Review.js</p>
<pre><code>const Product = require(&quot;./Product&quot;);

[...]

ReviewSchema.post(&quot;save&quot;, async function () {
  const reviewsAboutProduct = await Review.find({ product: this.product });

  const total = reviewsAboutProduct.reduce((prevValue, review) =&gt; {
    return prevValue + review.rating;
  }, 0);

  const averageRating = total / reviewsAboutProduct.length;
  console.log(total, averageRating);
// below is the line referenced in the response error message
  const product = Product.findOne({_id: product}); 
  product.averageRating = averageRating;
  product.save();
});

const Review = mongoose.model(&quot;Review&quot;, ReviewSchema);
module.exports = Review;
</code></pre>
<p>I think because of this circular dependency, I get the following error:</p>
<pre><code>(node:8696) Warning: Accessing non-existent property 'findOne' of module exports inside circular dependency
</code></pre>
<p>And in the response:</p>
<pre><code>&lt;pre&gt;ReferenceError: Cannot access &amp;#39;product&amp;#39; before initialization&lt;br&gt; &amp;nbsp; &amp;nbsp;at model.&amp;lt;anonymous&amp;gt; (\models\Review.js:47:42)
</code></pre>
<p>What should I do? Thank you for your time and help.</p>

