How to elegantly PATCH changes into mongodb without path conflicts<p>So I'm attempting to do a PATCH request to a MongoDB store, by <a href="https://stackoverflow.com/questions/56527121/findoneandupdate-nested-object-in-array">updating an element in an sub-array</a>. This is what the data looks like:</p>
<pre class="lang-js prettyprint-override"><code>const booksSchema = mongoose.Schema(
  {
    name: { type: String, trim: true },
    author: { type: String, trim: true },
  },
  { timestamps: true },
)
const Book = mongoose.model('Book', bookSchema)

const librarySchema = mongoose.Schema(
  { books: [ Books.schema ] },
  { timestamps: true },
)
const Library = mongoose.model('Library', librarySchema)
</code></pre>
<p>And this is how I'm updating the data:</p>
<pre class="lang-js prettyprint-override"><code>  const library = await Library.findOneAndUpdate(
    { _id: libraryId, &quot;books._id&quot;: bookId },
    { $set: { &quot;books.$&quot;: bookBody } },
  )
</code></pre>
<p>And in the process, I've run into problems with the <a href="https://stackoverflow.com/questions/63994447/mongodb-update-in-array-fails-updating-the-path-companies-updatedat-would-c">automated timestamp update conflicting with the $set command</a>:</p>
<pre class="lang-sh prettyprint-override"><code>Updating the path 'books.$.updatedAt' would create a conflict at 'books.$'
</code></pre>
<p>The best solution I've come across to make this type of update without removing the automated timestamp update is to <a href="https://stackoverflow.com/questions/68389844/mongoerror-updating-the-path-publications-pub-updatedat-would-create-a-con">manually set each field</a>, like this:</p>
<pre class="lang-js prettyprint-override"><code>  const library = await Library.findOneAndUpdate(
    { _id: libraryId, &quot;book._id&quot;: bookId },
    {
      $set: {
        &quot;book.$.name&quot;: bookBody.name,
        &quot;book.$.author&quot;: bookBody.author,
      }
    },
  )
</code></pre>
<p>...but this solution is very verbosely.</p>
<p><strong>Is there a more elegant way to do this type of PATCH request, perhaps using some kinda of object destructuring, that doesn't require maintaining a mapping of each field?</strong></p>

