Create a button that DELETES an item from MongoDB (Mongoose Node.js express.js)<p>I have a CRUD project where a user can insert data with forms and it's all stored in mongoDB. Everything seems to work fine but I can't find a solution on how to create a button that deletes a specific item from a DB.</p>
