<pre><code>&lt;form action=&quot;/delete/:id&quot; method=&quot;post&quot;&gt;
&lt;button type='submit' class=&quot;btn btn-lg&quot;&gt;Delete&lt;/button&gt;
&lt;/form&gt;
</code></pre>
<p>//This is my solution so far</p>
<pre><code>app.post('/delete/:id', (req, res) =&gt; {
  Post.deleteOne((err) =&gt; {
    if (!err) {
      res.redirect('/')
    }
  })
});
